import React, { FC } from 'react';
import { Link } from 'react-router-dom';

import headerStyles from './Header.module.scss';
import { useAppSelector } from '../../store';

const Header: FC = () => {
  const isUserLoggedIn = useAppSelector((state) => state.userInfo.isUserLoggedIn);

  return (
    <div className={headerStyles.items}>
      <a href="/" className={headerStyles.listDecoration}>
        META_BLOG
      </a>
      {!isUserLoggedIn ? <div>
        <Link to="/login" className={headerStyles.listDecoration}>
          Sign In
        </Link>
        <Link
          to="/register"
          className={`${
            (headerStyles.listDecoration,
              headerStyles.listDecoration__signupBackground)
          }`}
        >
          Sign Up
        </Link>
      </div> : ' '}

    </div>
  );
};

export default Header;
